// src/App.js (kısaltılmış hali)

import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from './Layout';
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import LogsPage from './pages/LogsPage';
import FirewallRulesPage from './pages/FirewallRulesPage';
import UpdatesPage from './pages/UpdatesPage';
import ReportsPage from './pages/ReportsPage';
import SettingsPage from './pages/SettingsPage';

// 1) Yeni import
import NetworkInterfacesPage from './pages/NetworkInterfacesPage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<LoginPage />} />

        <Route
          path="/"
          element={<Layout><DashboardPage /></Layout>}
        />
        <Route
          path="/logs"
          element={<Layout><LogsPage /></Layout>}
        />
        <Route
          path="/updates"
          element={<Layout><UpdatesPage /></Layout>}
        />
        <Route
          path="/rules"
          element={<Layout><FirewallRulesPage /></Layout>}
        />
        <Route
          path="/reports"
          element={<Layout><ReportsPage /></Layout>}
        />
        <Route
          path="/settings"
          element={<Layout><SettingsPage /></Layout>}
        />

        {/* 2) Yeni route ekliyoruz */}
        <Route
          path="/network"
          element={<Layout><NetworkInterfacesPage /></Layout>}
        />

      </Routes>
    </BrowserRouter>
  );
}

export default App;
